import { Routes, Route } from "react-router-dom";
import SignupLoginPage from "./components/SignupLoginPage";

function App() {
  return (
    <div>
      <Routes>
       <Route path = "/" element={<SignupLoginPage />}></Route>
      </Routes>
    </div>
  );
}

export default App;
